import React from 'react';
import Sender from "./Sender";
import ComposeMessageBtn from "./ComposeMessageBtn";

class ConversationsHeader extends React.Component{
    constructor(props){
        super(props);
    }

    render() {
        const sender = this.props.conversations.length ? this.props.conversations[0].sender.data : {} ;
        return (
            <div className="box-header with-border">
                <Sender user={sender} totalMessage={this.props.conversations.length}/>
                <div className="box-tools">
                    <ComposeMessageBtn/>
                </div>
            </div>
        );
    }
}

export default ConversationsHeader;
